Does it affect any algorithm?</p>","post_number":1,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:06:43.918Z","reply_count":1,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":53,"reads":264,"readers_count":263,"score":337.8,"yours":false,"topic_id":399906,"topic_slug":"rectengular-swerve-with-mk4","display_username":"Ofek Harel","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":40752,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"3339 Software Lead Mentor"},"post_url":"/t/rectengular-swerve-with-mk4/399906/1","custom_user_title":"3339 Software Lead Mentor","reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null,"can_vote":false},{"id":2989987,"name":"Wolly :)","username":"wolly_efendi","avatar_template":"/user_avatar/www.chiefdelphi.com/wolly_efendi/{size}/165245_2.png","created_at":"2022-01-12T16:10:13.903Z","cooked":"<p>Could you explain what you mean by ‘rectangular’? I think you’re referring to a non-square drivebase. In that case, the module angle for the turning contribution is not exactly 45°, its the atan of length/2 and width/2 (in a square chassis, length and width are the same, so atan(length/2 / width/2) is 45°). I haven’t worked with any official code so someone else should be able to chime in.</p>","post_number":2,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:10:13.903Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":2,"reads":258,"readers_count":257,"score":61.6,"yours":false,"topic_id":399906,"topic_slug":"rectengular-swerve-with-mk4","display_username":"Wolly :)","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":49878,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/rectengular-swerve-with-mk4/399906/2","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":2989992,"name":"","username":"andrew2","avatar_template":"/user_avatar/www.chiefdelphi.com/andrew2/{size}/159457_2.png","created_at":"2022-01-12T16:14:07.927Z","cooked":"<p>If you mean rectangular as in not a square but still a rectangle with 90degree angles we have some experience. Last year and this year we made a swerve with a frame of 27’ width and 24’ length. All this did coding wise was change the kinematics numbers that you put in The built in kinematics does the math and takes care of the angle for you. The same should be the same with the base mk4 code and we have our code published on github if it helps.</p>","post_number":3,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:17:34.895Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":238,"readers_count":237,"score":62.6,"yours":false,"topic_id":399906,"topic_slug":"rectengular-swerve-with-mk4","display_username":"","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":47806,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/rectengular-swerve-with-mk4/399906/3","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":2989997,"name":"kgzak","username":"kgzak","avatar_template":"/user_avatar/www.chiefdelphi.com/kgzak/{size}/157079_2.png","created_at":"2022-01-12T16:17:39.995Z","cooked":"<p>I am not familiar with SDS code but the WPI lib asks for module positions to account for this and Strike Force’s third coast uses track width/length to account for it.</p>","post_number":4,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:17:39.995Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":0,"reads":223,"readers_count":222,"score":74.6,"yours":false,"topic_id":399906,"topic_slug":"rectengular-swerve-with-mk4","display_username":"kgzak","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","bookmarked":false,"actions_summary":[{"id":2,"count":2}],"moderator":false,"admin":false,"staff":false,"user_id":11043,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":""},"post_url":"/t/rectengular-swerve-with-mk4/399906/4","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":2}],"current_user_reaction":null,"reaction_users_count":2,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":2989999,"name":"Brad","username":"Bmongar","avatar_template":"/user_avatar/www.chiefdelphi.com/bmongar/{size}/228654_2.png","created_at":"2022-01-12T16:18:01.376Z","cooked":"<p>With the SDS code all you need to do is set up the Kinematics for your geometry you use the offsets from center of rotation for each module.  If what you mean is non square.   The example will work for a rectangle as well as a square because it sets based on track width and wheel base (length)</p>
<pre><code class="lang-auto">private final SwerveDriveKinematics m_kinematics = new SwerveDriveKinematics(
            // Front left
            new Translation2d(DrivetrainGeometry.TRACKWIDTH_METERS / 2.0, DrivetrainGeometry.WHEELBASE_METERS / 2.0),
            // Front right
            new Translation2d(DrivetrainGeometry.TRACKWIDTH_METERS / 2.0, -DrivetrainGeometry.WHEELBASE_METERS / 2.0),
            // Back left
            new Translation2d(-DrivetrainGeometry.TRACKWIDTH_METERS / 2.0, DrivetrainGeometry.WHEELBASE_METERS / 2.0),
            // Back right
            new Translation2d(-DrivetrainGeometry.TRACKWIDTH_METERS / 2.0, -DrivetrainGeometry.WHEELBASE_METERS / 2.0));</code></pre>","post_number":5,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:29:17.567Z","reply_count":0,"reply_to_post_number":1,"quote_count":0,"incoming_link_count":6,"reads":212,"readers_count":211,"score":87.4,"yours":false,"topic_id":399906,"topic_slug":"rectengular-swerve-with-mk4","display_username":"Brad","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":40752,"username":"OfekHarel","name":"Ofek Harel","avatar_template":"/user_avatar/www.chiefdelphi.com/ofekharel/{size}/134749_2.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":38557,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"5126 Codenator / Electrical, CSA, FTAA, Inspector "},"post_url":"/t/rectengular-swerve-with-mk4/399906/5","custom_user_title":"5126 Codenator / Electrical, CSA, FTAA, Inspector ","reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":2990012,"name":"Ofek Harel","username":"OfekHarel","avatar_template":"/user_avatar/www.chiefdelphi.com/ofekharel/{size}/134749_2.png","created_at":"2022-01-12T16:28:33.252Z","cooked":"<p>To clerify i meant a non square shape, rectangle with 90deg…</p>","post_number":6,"post_type":1,"posts_count":8,"updated_at":"2022-01-12T16:28:33.252Z","reply_count":1,"reply_to_post_number":null,